userDefinedLinkHintCss:
div.internal-vimium-hint-marker.vimiumHintMarker {
  background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#FFF785),
  color-stop(100%,#FFC542));
  border: 1px solid #E3BE23;
}

div.internal-vimium-hint-marker.vimiumHintMarker span {
  color: black;
  font-weight: bold;
  font-size: 16px;
}

div.internal-vimium-hint-marker.vimiumHintMarker span.matchingCharacter {
  color: peru;
}
